import React from 'react'
import {connect} from 'react-redux'
function Guess(props) {
    return (
        <div>
            <ul>{props.Guesss}</ul>
        </div>
    )
}
const mapStateToProps = (state) => {
    return {
        Guesss: state.guess
    }
}

export default connect (mapStateToProps)(Guess)
